(31, 1, '2022-03-10 11:52:48', '2022-03-10 14:52:48', '<div id=\"soloed-inicio\" class=\"row\">\r\n<div class=\"col-md-5 col-sm-1\">\r\n<h1 class=\"soloed-title\">Evolua sua forma de contratar com a SoloED</h1>\r\n<p class=\"soloed-text\">Lorem Ipsum is simply dummy text of the printing and typesetting industry.</p>\r\n<button class=\"soloed-button\" name=\"planos\">CONHEÇA OS PLANOS</button>\r\n\r\n</div>\r\n<div class=\"col-md col-sm\">\r\n<div class=\"soloed-image\"><img class=\"alignnone wp-image-64 size-full\" src=\"http://localhost/soloed/wp-content/uploads/2022/03/top-img.png\" alt=\"SoloED\" width=\"561\" height=\"375\" /></div>\r\n</div>\r\n</div>\r\n<div id=\"soloed-sobre\" class=\"row\">\r\n<div class=\"col-md col-sm-1\">\r\n<div class=\"soloed-image\"><img class=\"alignnone wp-image-91 size-full\" src=\"http://localhost/soloed/wp-content/uploads/2022/03/sobre-nos.png\" alt=\"Sobre Nós\" width=\"571\" height=\"412\" /></div>\r\n</div>\r\n<div class=\"col-md-5 col-sm-1\">\r\n<h2 class=\"soloed-title\">Sobre Nós</h2>\r\n<p class=\"soloed-text\">Lorem ipsum dolor sit amet, consectetur adipiscing elit. Suspendisse sagittis arcu quis nisi luctus, id accumsan felis tristique. Proin quis bibendum diam. Sed consequat nisl laoreet eros ultricies pellentesque. Nullam in est porta, pellentesque massa vitae, vehicula risus.</p>\r\n<p class=\"soloed-text\">In placerat, felis vitae sodales dictum, lacus quam pretium mi, ut pretium urna turpis eu dui. Vestibulum id ullamcorper nibh. Donec luctus, nunc finibus elementum suscipit, tortor augue vulputate sapien, vitae feugiat enim augue sed.</p>\r\n<p class=\"soloed-text\">Quisque id aliquam elit. Suspendisse congue pharetra maximus. Duis rutrum velit a leo euismod dictum. Sed sodales est efficitur arcu tincidunt tincidunt. Curabitur fringilla, risus at feugiat feugiat, nisl nulla tincidunt tellus, elementum elementum lorem nisl eleifend dolor. Nullam eget dui at sem ullamcorper luctus.</p>\r\n\r\n</div>\r\n\r\n<hr class=\"soloed-separator\" />\r\n\r\n</div>\r\n<div id=\"soloed-servicos\" class=\"row\">\r\n<div class=\"col-lg col-sm-1\">\r\n<h2 class=\"soloed-title servicos-title\">Serviços/Qualidades</h2>\r\n</div>\r\n</div>\r\n<div class=\"row\">\r\n<div class=\"col-lg col-sm-1\">\r\n<p class=\"soloed-text servicos-subtitle\">Lorem Ipsum is simply dummy text of the printing and typesetting industry. Lorem Ipsum has been the industry\'s standard dummy text ever since.</p>\r\n\r\n</div>\r\n</div>\r\n<div class=\"row\">\r\n<div class=\"col-lg col-sm-1 servicos-grid\">[featured-content cat_id=\"8\" grid=\"3\" design=\"design-1\"]</div>\r\n</div>\r\n<div id=\"soloed-depoimentos\" class=\"row\">\r\n<div class=\"col-lg col-sm-1\">\r\n<h2 class=\"soloed-title servicos-title\">Depoimentos de quem já passou por aqui</h2>\r\n</div>\r\n</div>\r\n<div class=\"row\">\r\n<div class=\"col-lg col-sm-1\">[ap_custom_testimonial type=\'slider-layout\' template=\'template-1\' slider_mode=\'horizontal\' slider_speed=\'1000\' adaptive_height=\'true\' slider_control=\'false\' slider_pager=\'true\' auto=\'false\' pause_duration=\'6000\' display_num=\'all\' content_length=\'full\' custom_layout=\'enable\' title=\'show\' comp_detail=\'show\' email=\'show\' rating=\'hide\' order_by=\'id\' order_type=\'ASC\' date=\'hide\' image=\'show\']</div>\r\n</div>', 'Landing Page', '', 'publish', 'closed', 'closed', '', 'landing-page', '', '', '2022-03-11 00:56:16', '2022-03-11 03:56:16', '', 0, 'http://localhost/soloed/?page_id=31', 0, 'page', '', 0),
